import React from 'react';
import FormOption from './FormOption';
import './Form.css';

class Form extends React.Component{
    constructor(props){
        super(props);
        this.state={
            loginSelected: false,
            signupSelected: true
        };
    }
    render(){
        return <form>
                <FormOption text="Login" 
                    height="5%" 
                    width="37%"
                    left="5%"
                    top="2%"
                    padding="3%"
                >
                </FormOption>
                <FormOption text="Sign Up" 
                    height="5%" 
                    width="37%"
                    left="50%"
                    top="2%"
                    padding="3%"
                >
                </FormOption>
                <label id="lb1">Email ID <input type="text" placeholder="email@gmail.com" name="email"/></label>
                <label id="lb2">Password <input type="password" placeholder="password" name="password"/></label>
                <label id="lb3">Confirmation <input type="password" placeholder="confirm password" name="confirmation"/></label>
                <button>Sign Up</button>
            </form>;
    }
}
export default Form;
